import React from 'react';
import Navigation from '../components/Navigation';

const Claude = () =>{
  return(
    <div>

    	<Navigation />
    	<div className="infoProfil">
	    	<div className="id">
	    		<div className= "idContent">
	    			<img src="./media/claude.jpg" alt="profil-pic"/>
	    			<h3>Claude</h3>
	    		</div>
	    	</div>

	    </div>
    </div>

    );
};

export default Claude;
